import React from "react";
import HomeNavbar from "../NavBar/HomeNavbar";
import './home.css'


class Home extends React.Component {

    render() {
        return (
            <div className={"home"}>
                <div className={"aboutus"}>
                    <div className={"d-flex flex-row justify-content-around"}>
                        <h1 className={"mx-5"}>Budget Manager</h1>
                        <HomeNavbar />
                    </div>


                    <div className={"info"}>
                        <div className={"infosection mx-4"}>
                            <h4>
                                Simple way to manage personal finances</h4>
                            <p>It creates clear visualize categories such as Food, Shopping, Gift etc.
                            to track your expenses</p>
                            <p> Budget Manager also helps you to improve your spending habits with custom goals that keep you going. </p>
                            <div className={"homeImage"}>

                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Home;
